import SignUp from "./SignUp";
import Login from "./Login";
import '../CSSContents/Profile.css'
import { BrowserRouter as Router, Link } from "react-router-dom";

function Profile() {




    return (
        <div className='Profile'>
            <Router>
                <div>
                    <Link to='/SigUp'>
                        <button>SignUp </button>
                    </Link>
                </div>
            </Router>


        </div >
    )
}

export default Profile;
